import { Wrap } from "../styled";
import { Img } from "./styled";

export default function CompanyCard() {
  return (
    <Wrap key={props.title}>
      <Img src={props.imgUrl} alt='Company' />
      <Title>{props.title}</Title>
    </Wrap>
  );
}
